-- ----------------------------
-- View structure for `v_rcsj`
-- ----------------------------
DROP VIEW IF EXISTS `v_rcsj`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `v_rcsj` AS select `a`.`sfhj` AS `sfhj`,`b`.`kccrkhj` AS `kccrkhj`,`b`.`kcrkzj` AS `kcrkzj`,`b`.`kcckzj` AS `kcckzj`,`b`.`hccrkhj` AS `hccrkhj`,`b`.`hcrkzj` AS `hcrkzj`,`b`.`hcckzj` AS `hcckzj`,`b`.`mzcrkhj` AS `mzcrkhj`,`b`.`mzrkzj` AS `mzrkzj`,`b`.`mzckzj` AS `mzckzj`,`b`.`crkllhj` AS `crkllhj`,`b`.`rkllzj` AS `rkllzj`,`b`.`ckllzj` AS `ckllzj`,`a`.`xjhj` AS `xjhj`,`a`.`zcsr` AS `zcsr`,`a`.`jzsr` AS `jzsr`,`a`.`jsk` AS `jsk`,`a`.`ck` AS `ck`,`a`.`etccq` AS `etccq`,`a`.`sszd` AS `sszd`,`a`.`zdmc` AS `zdmc`,`b`.`kcsrzj` AS `kcsrzj`,`b`.`hcsrzj` AS `hcsrzj`,`a`.`sfrq` AS `sfrq`,`b`.`zt` AS `zt` from (`fx_rcsj` `a` join `fx_rcclhz` `b`) where ((`a`.`sszd` = `b`.`sszd`) and (`a`.`sfrq` = `b`.`sfrq`)) group by `a`.`sszd`,`a`.`sfrq` ;

