CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `v_test` AS select coalesce(`a`.`sfhj`,0) AS `sfhj`,coalesce(`b`.`kccrkhj`,0) AS `kccrkhj`,coalesce(`b`.`kcrkzj`,0) AS `kcrkzj`,coalesce(`b`.`kcckzj`,0) AS `kcckzj`,coalesce(`b`.`hccrkhj`,0) AS `hccrkhj`,coalesce(`b`.`hcrkzj`,0) AS `hcrkzj`,coalesce(`b`.`hcckzj`,0) AS `hcckzj`,coalesce(`b`.`mzcrkhj`,0) AS `mzcrkhj`,coalesce(`b`.`mzrkzj`,0) AS `mzrkzj`,coalesce(`b`.`mzckzj`,0) AS `mzckzj`,coalesce(`b`.`crkllhj`,0) AS `crkllhj`,coalesce(`b`.`rkllzj`,0) AS `rkllzj`,coalesce(`b`.`ckllzj`,0) AS `ckllzj`,coalesce(`a`.`xjhj`,0) AS `xjhj`,coalesce(`a`.`zcsr`,0) AS `zcsr`,coalesce(`a`.`jzsr`,0) AS `jzsr`,coalesce(`a`.`jsk`,0) AS `jsk`,coalesce(`a`.`ck`,0) AS `ck`,coalesce(`a`.`etccq`,0) AS `etccq`,`a`.`sszd` AS `sszd`,`a`.`zdmc` AS `zdmc`,coalesce(`b`.`kcsrzj`,0) AS `kcsrzj`,coalesce(`b`.`hcsrzj`,0) AS `hcsrzj`,`a`.`sfrq` AS `sfrq`,`a`.`zt` AS `zt` from (`fx_rcsj` `a` left join `fx_rcclhz` `b` on(((`a`.`sfrq` = `b`.`sfrq`) and (`a`.`sszd` = `b`.`sszd`)))) union select coalesce(`a`.`sfhj`,0) AS `sfhj`,coalesce(`b`.`kccrkhj`,0) AS `kccrkhj`,coalesce(`b`.`kcrkzj`,0) AS `kcrkzj`,coalesce(`b`.`kcckzj`,0) AS `kcckzj`,coalesce(`b`.`hccrkhj`,0) AS `hccrkhj`,coalesce(`b`.`hcrkzj`,0) AS `hcrkzj`,coalesce(`b`.`hcckzj`,0) AS `hcckzj`,coalesce(`b`.`mzcrkhj`,0) AS `mzcrkhj`,coalesce(`b`.`mzrkzj`,0) AS `mzrkzj`,coalesce(`b`.`mzckzj`,0) AS `mzckzj`,coalesce(`b`.`crkllhj`,0) AS `crkllhj`,coalesce(`b`.`rkllzj`,0) AS `rkllzj`,coalesce(`b`.`ckllzj`,0) AS `ckllzj`,coalesce(`a`.`xjhj`,0) AS `xjhj`,coalesce(`a`.`zcsr`,0) AS `zcsr`,coalesce(`a`.`jzsr`,0) AS `jzsr`,coalesce(`a`.`jsk`,0) AS `jsk`,coalesce(`a`.`ck`,0) AS `ck`,coalesce(`a`.`etccq`,0) AS `etccq`,`b`.`sszd` AS `sszd`,`b`.`zdmc` AS `zdmc`,coalesce(`b`.`kcsrzj`,0) AS `kcsrzj`,coalesce(`b`.`hcsrzj`,0) AS `hcsrzj`,`b`.`sfrq` AS `sfrq`,`b`.`zt` AS `zt` from (`fx_rcclhz` `b` left join `fx_rcsj` `a` on(((`a`.`sfrq` = `b`.`sfrq`) and (`a`.`sszd` = `b`.`sszd`)))) ;

-- ----------------------------
-- Procedure structure for `p_chsr`
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_chsr`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `p_chsr`(v_by varchar(6),v_bn varchar(6),v_sy varchar(6),v_sn varchar(6))
begin
	 DECLARE mc VARCHAR(64); 
	 DECLARE orgId VARCHAR(64);
	 DECLARE done int default 0;
	 DECLARE cursor_name CURSOR FOR select organizeid,fullname from sys_organize WHERE parentid !='0' ORDER BY sortcode;   
	 DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;
	--
	TRUNCATE TABLE report_tmp_chsr;
	OPEN cursor_name; 
  REPEAT -- 循环
    FETCH cursor_name INTO orgId, mc;-- 
    IF NOT done THEN
    END IF;
  UNTIL done END REPEAT;-- 结束循环 
  CLOSE cursor_name;-- 
	-- 处理数据
	-- 本月拆前
	UPDATE report_tmp_chsr tmp LEFT JOIN (
	SELECT ld.fullname,SUM(xjhj) as cqsr
	FROM fx_rcsj t ,sys_department dept,sys_department ld
	WHERE date_format(sfrq, '%Y%m') = v_by
	and t.sszd = dept.departmentid
	AND dept.parentid = ld.departmentid and zt>1
	GROUP BY ld.departmentid) tt ON tmp.mc = tt.fullname
	SET tmp.cqsr = IFNULL(tt.cqsr,0);
	-- 本年
	UPDATE report_tmp_chsr tmp LEFT JOIN (
	SELECT ldmc as fullname, YEAR(sfrq) yf, SUM(chhj) as chsr FROM fx_chsjyb
	WHERE zt>1 and YEAR(sfrq) =v_bn GROUP BY ldmc) tt ON tmp.mc = tt.fullname
	SET tmp.bnchsr = IFNULL(tt.chsr,0);

	-- 本月
	UPDATE report_tmp_chsr tmp LEFT JOIN (
	SELECT ldmc as fullname,SUM(chhj) as chsr FROM fx_chsjyb
	WHERE zt>1 and date_format(sfrq,'%Y%m') =v_by GROUP BY ldmc) tt ON tmp.mc = tt.fullname
	SET tmp.chsr = IFNULL(tt.chsr,0);
	-- 上月
	UPDATE report_tmp_chsr tmp LEFT JOIN (
	SELECT ldmc as fullname, SUM(chhj) as chsr FROM fx_chsjyb
	WHERE zt>1 and date_format(sfrq,'%Y%m') =v_sy GROUP BY ldmc) tt ON tmp.mc = tt.fullname
	SET tmp.sqchsr = IFNULL(tt.chsr,0);
	-- 同期
	UPDATE report_tmp_chsr tmp LEFT JOIN (
	SELECT ldmc as fullname, SUM(chhj) as chsr FROM fx_chsjyb
	WHERE zt>1 and date_format(sfrq,'%Y%m') =v_sn GROUP BY ldmc) tt ON tmp.mc = tt.fullname
	SET tmp.tqchsr = IFNULL(tt.chsr,0);
	
	
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `p_chsr_all`
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_chsr_all`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `p_chsr_all`(v_by varchar(6),v_bn varchar(6),v_sy varchar(6),v_sn varchar(6))
begin
	CALL p_chsr(v_by,v_bn,v_sy,v_sn);
	--
	UPDATE report_tmp_chsr tmp ,(
	SELECT orgId,SUM(cqsr) cqsr,SUM(tqchsr) tqchsr,SUM(sqchsr) sqchsr,SUM(chsr) chsr,SUM(bnchsr) bnchsr FROM report_tmp_chsr
	GROUP BY orgId
	) tt 
	SET tmp.cqsr=IFNULL(tt.cqsr,0),tmp.tqchsr=IFNULL(tt.tqchsr,0),tmp.sqchsr=IFNULL(tt.sqchsr,0),tmp.chsr=IFNULL(tt.chsr,0),tmp.bnchsr=IFNULL(tt.bnchsr,0)
	WHERE tmp.orgId = tt.orgId AND tmp.f=1;

	SELECT mc,cqsr,tqchsr,sqchsr,chsr,bnchsr FROM report_tmp_chsr;
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `fn_getDict_ID`
-- ----------------------------
DROP FUNCTION IF EXISTS `fn_getDict_ID`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `fn_getDict_ID`(`pid` int) RETURNS int(11)
BEGIN
	DECLARE _zdbm INT;
	SET _zdbm = 0;	
	IF LENGTH(pid)>1 THEN
		SELECT (1+(CASE WHEN MAX(dictid) IS NULL THEN (pid*1000) ELSE MAX(dictid) END)) INTO _zdbm FROM sys_dict WHERE left(dictid,3) = pid AND dictid!=pid;
	ELSE
		SELECT (IFNULL(MAX(dictid),99)+1) INTO _zdbm FROM sys_dict WHERE LENGTH(dictid)=3;
	END IF;
	return _zdbm;
END
;;
DELIMITER ;
